def get_frames():
	frames = []
	for i in range(len(_frames)):
		frames.append(Image.fromarray(_frames[i]*255, 'L').convert('1'))
	return frames

def play(d, event):
	while not event.is_set():
		for i in range(len(frames)):
			if not event.is_set():
				with regulator:
					d.display(frames[i])

frames = get_frames()
regulator = framerate_regulator(fps=3)
